import React from 'react'
import LeagueButton from './LeagueButton';

export default class NavigationBar extends React.Component {

    render() {
        return(
            <div className='nav-bar'>
                <LeagueButton league='Ligue 1'></LeagueButton>
                <LeagueButton league='Bundesliga'></LeagueButton>
                <LeagueButton league='Premier League'></LeagueButton>
            </div>
        )
    }
}
